import React  from 'react';
import Button from '@material-ui/core/Button';

export default function LoginView() {
    return (
        <div>
            <Button variant="contained" color="primary" disableElevation>
                SignIn
            </Button>
            <Button variant="contained" color="primary" disableElevation>
                SignUp
            </Button>
        </div>
    );
  }
